import React,{useState} from "react";

import {
  TextField,
  Grid,
  Paper,
  Avatar,
  Button,
  FormControlLabel,
  Checkbox,
  Typography,
} from "@mui/material";
import AddCircleOutlineIcon from '@mui/icons-material/AddCircleOutline';
import { Link } from "react-router-dom";

export function SignUp(){
  const [name ,setName] = useState("")
  const [email , setEmail] = useState("")
  const [password ,setPassword] = useState("")
  const [confPassword, setConfPassword] = useState("");
  const [phone, setPhone] = useState("");


  const paperStyle = {
    padding: 20,
    height: "100vh",
    align: "center",
    width: 400,
    margin: "20px auto",
  };

  const handelSubmit =(e) =>{
    e.preventDefault();
  if(password == password){
    
  }
  }


  const avatarStyle = { backgroundColor: "#1bbd7e" };

  return(
      <div>
        <Grid>
          <Paper elevation={10} style={paperStyle}>
            <Grid align="center">
              <Avatar style={avatarStyle}>
                <AddCircleOutlineIcon/>
              </Avatar>
            </Grid>
            <br />
            <h1 style={{"text-align": "center" }}>Create Account</h1>
            <div style={{ width : 300 , "padding-left" :"50px"}}>
              
              <TextField variant="outlined" label="name" type="name" fullWidth value={name} onChange={(e)=>{setName(e.target.value)}} />
              <br /><br/>
              <TextField variant="outlined" label="Email" type="email" fullWidth value={email} onChange={(e)=>{setEmail(e.target.value)}} />
              <br /><br/>
              <TextField variant="outlined" label="Phone Number" type="Number" fullWidth value={phone} onChange={(e)=>{setPhone(e.target.value)}} />
              <br/><br/>
              <TextField variant="filled" label="Password" type="password" fullWidth value={password} onChange={(e)=>{setPassword(e.target.value)}}/>
              <br /><br />
              <TextField variant="filled" label="ConformPassword" type="password" fullWidth value={confPassword} onChange={(e)=>{setConfPassword(e.target.value)}}/>
            </div>
            <FormControlLabel
              control={<Checkbox name="checkedB" color="primary" />}
              label="Remember me"
            />
            <br /><br />
            <Button type="submit" color="primary" variant="contained" fullWidth onClick={handelSubmit}>
              Sign up
            </Button>
            <br /><br />
            <Typography>
              <Link href="#">already account create</Link>
            </Typography>
           
          </Paper>
        </Grid>
      </div>
   
  )


}
